// src/pages/Home.js

import React, { useRef, useEffect } from 'react';
import { motion, useScroll, useTransform } from 'framer-motion';
import { Link } from 'react-router-dom';
import { homeData } from '../data';
import TestimonialSlideshow from '../components/TestimonialSlideshow';
import '../styles/Home.css';

const Home = () => {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  const heroRef = useRef(null);
  const galleryRef = useRef(null);
  const servicesImageRef = useRef(null);

  // Parallax for Hero section
  const { scrollYProgress: heroScrollYProgress } = useScroll({
    target: heroRef,
    offset: ['start end', 'end start'],
  });
  const heroBgY = useTransform(heroScrollYProgress, [0, 1], ['-20%', '20%']);

  // Parallax and Zoom for Services Image section
  const { scrollYProgress: servicesScrollYProgress } = useScroll({
    target: servicesImageRef,
    offset: ['start end', 'end start'],
  });
  const servicesBgY = useTransform(servicesScrollYProgress, [0, 1], ['-10%', '10%']); // Subtle parallax
  const servicesBgScale = useTransform(servicesScrollYProgress, [0, 1], [1.05, 1]); // Zoom out slightly on scroll

  // Parallax for Gallery section
  const { scrollYProgress: galleryScrollYProgress } = useScroll({
    target: galleryRef,
    offset: ['start end', 'end start'],
  });
  const galleryBgY = useTransform(galleryScrollYProgress, [0, 1], ['-20%', '20%']);

  return (
    <div className="home-page-clone">

      {/* Section 1: Services */}
      <section className="services-section">
        <div className="services-text-column">
          <div className="services-content">
            <h2>{homeData.services.title}</h2>
            {/* Elegant floral icon */}
            <div className="services-icon">
              <svg viewBox="0 0 100 60" className="floral-ornament">
                <g fill="none" stroke="#b8a082" strokeWidth="1.5">
                  <path d="M20 30 Q 30 20, 40 30 Q 50 40, 60 30 Q 70 20, 80 30" />
                  <circle cx="30" cy="25" r="3" fill="#b8a082" opacity="0.6" />
                  <circle cx="50" cy="35" r="2.5" fill="#b8a082" opacity="0.4" />
                  <circle cx="70" cy="25" r="2" fill="#b8a082" opacity="0.5" />
                  <path d="M25 30 L35 30 M45 30 L55 30 M65 30 L75 30" strokeWidth="0.8" opacity="0.3" />
                </g>
              </svg>
            </div>
            <p>{homeData.services.subtitle}</p>
            <Link to={homeData.services.buttonLink} className="discover-button">{homeData.services.buttonText}</Link>
          </div>
        </div>
        <motion.div 
          ref={servicesImageRef}
          className="services-image-column" 
          style={{
            backgroundImage: `url(${homeData.services.image})`,
            y: servicesBgY,
            scale: servicesBgScale
          }}
        />
      </section>

      {/* Section 2: Hero - Full-Screen with Text Overlay */}
      <section ref={heroRef} className="hero-section">
        <motion.div 
          className="parallax-background" 
          style={{ 
            y: heroBgY, 
            backgroundImage: `url(${homeData.hero.image})` 
          }} 
        />
        <div className="hero-pattern-overlay"></div>
        <div className="hero-content">
          <div className="hero-text-content">
            <h1 className="hero-main-title">Creating</h1>
            <h2 className="hero-subtitle">Unforgettable</h2>
            <h3 className="hero-accent">Experiences</h3>
          </div>
          <a href="#testimonials" className="hero-scroll-indicator" aria-label="Scroll down">
            <div className="scroll-dot"></div>
          </a>
        </div>
      </section>

      {/* Anchor for scrolling */}
      <div id="testimonials" style={{position: 'relative', top: '-80px'}}></div>

      {/* Section 3: Testimonials */}
      <section className="testimonials-section">
        <TestimonialSlideshow testimonials={homeData.testimonials} />
      </section>

      {/* Section 4: Gallery CTA */}
      <section ref={galleryRef} className="gallery-cta-section">
          <motion.div 
            className="parallax-background" 
            style={{ 
              y: galleryBgY, 
              backgroundImage: `url(${homeData.gallery.image})` 
            }} 
          />
          <div className="gallery-cta-overlay"></div>
          <div className="gallery-cta-content">
              <h2>{homeData.gallery.title}</h2>
              <p>{homeData.gallery.subtitle}</p>
              <Link to={homeData.gallery.buttonLink} className="discover-button-dark">{homeData.gallery.buttonText}</Link>
          </div>
      </section>

    </div>
  );
};

export default Home;
